Entries.RequestBody:
{
  "properties": {
    "template": {
      "$schema": "https://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json#",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "keyVaultName": {
          "type": "string",
          "metadata": {
            "description": "Name of the Vault"
          }
        },
        "tenantId": {
          "type": "string",
          "metadata": {
            "description": "Tenant Id for the subscription. Available from Get-AzureRMSubscription PowerShell cmdlet"
          }
        },
        "objectId": {
          "type": "string",
          "metadata": {
            "description": "Object Id of the AD user. Available from Get-AzureRMADUser or Get-AzureRMADServicePrincipal cmdlets"
          }
        },
        "keysPermissions": {
          "type": "array",
          "defaultValue": [
            "all"
          ],
          "metadata": {
            "description": "Permissions to grant user to keys in the vault. Valid values are: all, create, import, update, get, list, delete, backup, restore, encrypt, decrypt, wrapkey, unwrapkey, sign, and verify."
          }
        },
        "secretsPermissions": {
          "type": "array",
          "defaultValue": [
            "all"
          ],
          "metadata": {
            "description": "Permissions to grant user to secrets in the vault. Valid values are: all, get, set, list, and delete."
          }
        },
        "skuName": {
          "type": "string",
          "defaultValue": "Standard",
          "allowedValues": [
            "Standard",
            "Premium"
          ],
          "metadata": {
            "description": "SKU for the vault"
          }
        },
        "enabledForDeployment": {
          "type": "bool",
          "defaultValue": true,
          "metadata": {
            "description": "Specifies if the vault is enabled for a VM deployment"
          }
        },
        "enabledForTemplateDeployment": {
          "type": "bool",
          "defaultValue": true,
          "metadata": {
            "description": "Specifies if the vault is enabled for a ARM template deployment"
          }
        },
        "enableVaultForVolumeEncryption": {
          "type": "bool",
          "defaultValue": false,
          "metadata": {
            "description": "Specifies if the vault is enabled for volume encryption"
          }
        },
        "secretName": {
          "type": "string",
          "metadata": {
            "description": "Name of the secret to store in the vault"
          }
        },
        "secretValue": {
          "type": "securestring",
          "metadata": {
            "description": "Value of the secret"
          }
        }
      },
      "resources": [
        {
          "type": "Microsoft.KeyVault/vaults",
          "name": "[parameters('keyVaultName')]",
          "apiVersion": "2015-06-01",
          "location": "[resourceGroup().location]",
          "tags": {
            "displayName": "Vault"
          },
          "properties": {
            "enabledForDeployment": "[parameters('enabledForDeployment')]",
            "enabledForTemplateDeployment": "[parameters('enabledForTemplateDeployment')]",
            "enabledForVolumeEncryption": "[parameters('enableVaultForVolumeEncryption')]",
            "tenantId": "[parameters('tenantId')]",
            "accessPolicies": [
              {
                "tenantId": "[parameters('tenantId')]",
                "objectId": "[parameters('objectId')]",
                "permissions": {
                  "keys": "[parameters('keysPermissions')]",
                  "secrets": "[parameters('secretsPermissions')]"
                }
              }
            ],
            "sku": {
              "name": "[parameters('skuName')]",
              "family": "A"
            }
          },
          "resources": [
            {
              "type": "secrets",
              "name": "[parameters('secretName')]",
              "apiVersion": "2015-06-01",
              "tags": {
                "displayName": "secret"
              },
              "properties": {
                "value": "[parameters('secretValue')]"
              },
              "dependsOn": [
                "[concat('Microsoft.KeyVault/vaults/', parameters('keyVaultName'))]"
              ]
            }
          ]
        }
      ]
    },
    "parameters": {
      "keyVaultName": {
        "value": "onesdk6366"
      },
      "secretName": {
        "value": "onesdk2215"
      },
      "tenantId": {
        "value": "72f988bf-86f1-41af-91ab-2d7cd011db47"
      },
      "objectId": {
        "value": "d7395f87-388a-45ec-8bee-f23b038072bb"
      },
      "secretValue": {
        "value": "xDeploymentTestHost26668"
      }
    },
    "mode": "Incremental"
  }
}
